      string: '{"posts":[{"no":41689166,"now":"05\/01\/14(Thu)13:13:39","name":"Anonymous","com":"I
        don&#039;t know any programming languages but I would like to learn at least
        one. I&#039;ve been hearing a lot about Python, and it&#039;s supposedly the
        easiest to learn. Is it worth my time?","filename":"300px-Python-logo-notext.svg","ext":".png","w":300,"h":300,"tn_w":250,"tn_h":250,"tim":1398964419428,"time":1398964419,"md5":"d4glvjgb5m2yfVa6UzA06g==","fsize":13229,"resto":0,"bumplimit":0,"imagelimit":0,"semantic_url":"i-dont-know-any-programming-languages-but-i-would","replies":16,"images":1},{"no":41689178,"now":"05\/01\/14(Thu)13:14:31","name":"Anonymous","com":"Just
        learn some CSS. That way you&#039;ll at least get something out of it for
        customizing web-sites and making your own styles with stylish.","time":1398964471,"resto":41689166},{"no":41689182,"now":"05\/01\/14(Thu)13:14:46","name":"Anonymous","com":"Sure.
        Stick with 2.x though.","time":1398964486,"resto":41689166},{"no":41689201,"now":"05\/01\/14(Thu)13:15:56","name":"Anonymous","com":"Java
        or C# is where the money is.","time":1398964556,"resto":41689166},{"no":41689233,"now":"05\/01\/14(Thu)13:18:33","name":"Anonymous","com":"If
        you want a job in programming the current languages you want are Java or C#.<br><br>If
        you&#039;re just dicking around, pick whatever.<br><br>I wouldn&#039;t recommend
        pyshit, it enforces terrible coding practices.","time":1398964713,"resto":41689166},{"no":41689247,"now":"05\/01\/14(Thu)13:19:44","name":"Anonymous","com":"<a
        href=\"#p41689178\" class=\"quotelink\">&gt;&gt;41689178<\/a><br><a href=\"#p41689201\"
        class=\"quotelink\">&gt;&gt;41689201<\/a><br>I&#039;m a sysadmin, about to
        move into a networking position so I&#039;m not really looking to make money
        off of it, just for making useful tools for myself I guess. Google uses Python,
        shouldn&#039;t that make it good enough?","time":1398964784,"resto":41689166},{"no":41689274,"now":"05\/01\/14(Thu)13:21:59","name":"Anonymous","com":"Here
        you go:<br><br>http:\/\/learnpythonthehardway.org\/bo<wbr>ok\/<br><br>then
        learn C.","time":1398964919,"resto":41689166},{"no":41689293,"now":"05\/01\/14(Thu)13:23:49","name":"Anonymous","com":"<a
        href=\"#p41689166\" class=\"quotelink\">&gt;&gt;41689166<\/a><br>as babies
        first programming language, it really is the easiest, although I would recommend
        learning C first.","time":1398965029,"resto":41689166},{"no":41689321,"now":"05\/01\/14(Thu)13:26:22","name":"Anonymous","com":"<a
        href=\"#p41689274\" class=\"quotelink\">&gt;&gt;41689274<\/a><br><a href=\"#p41689293\"
        class=\"quotelink\">&gt;&gt;41689293<\/a><br>Why is C better than Python if
        they can be used for essentially the same tasks, while Python has a cleaner
        syntax without retarded brackets everywhere?","time":1398965182,"resto":41689166},{"no":41689531,"now":"05\/01\/14(Thu)13:40:25","name":"Anonymous","com":"<a
        href=\"#p41689166\" class=\"quotelink\">&gt;&gt;41689166<\/a><br>If you code
        for fun or want to learn fundamentals then C or something basic like python
        <br><br>If you want to be a job fast then Java all day everyday<br><br>If
        you want to embrace the future and do Web programming, and get an amazing
        job couple years down the road then Javascript and libraries -  angular etc","time":1398966025,"resto":41689166},{"no":41689585,"now":"05\/01\/14(Thu)13:44:14","name":"Anonymous","com":"<a
        href=\"#p41689247\" class=\"quotelink\">&gt;&gt;41689247<\/a><br>As a sysadmin
        you should really look into powershell instead.","time":1398966254,"resto":41689166},{"no":41689713,"now":"05\/01\/14(Thu)13:52:08","name":"Anonymous","com":"<a
        href=\"#p41689321\" class=\"quotelink\">&gt;&gt;41689321<\/a><br>C and Python
        should not be used for the same tasks.  Python is easier to write but runs
        much slower than compiled C code.  Only small parts of any program (which
        often will be in libraries someone else has written and you can just call)
        actually need to run fast, the parts containing loops executed a very large
        number of times.  These should be written in a C-like language, not a Python-like
        one.","time":1398966728,"resto":41689166},{"no":41689717,"now":"05\/01\/14(Thu)13:52:31","name":"Anonymous","com":"<a
        href=\"#p41689321\" class=\"quotelink\">&gt;&gt;41689321<\/a><br><br>Python
        is using an interpreter which makes it slower as C (which is using no interpreter).
        <br><br>But Python has an API with C. So you can start with Python and continue
        with C.","time":1398966751,"resto":41689166},{"no":41689763,"now":"05\/01\/14(Thu)13:55:45","name":"Anonymous","com":"<a
        href=\"#p41689717\" class=\"quotelink\">&gt;&gt;41689717<\/a><br>I&#039;m
        looking at something called Cython now. So I could code in Python and then
        translate it into C, make whatever changes and then compile it for best of
        both worlds?","time":1398966945,"resto":41689166},{"no":41689845,"now":"05\/01\/14(Thu)14:01:08","name":"Anonymous","com":"I
        first learned Python to get the idea how programming languages work in general.
        Now I&#039;m learning C and I can say that learning Python first helped me
        get into C better.","time":1398967268,"resto":41689166},{"no":41690158,"now":"05\/01\/14(Thu)14:25:08","name":"Anonymous","com":"<a
        href=\"#p41689321\" class=\"quotelink\">&gt;&gt;41689321<\/a><br><span class=\"quote\">&gt;brackets
        are retarded<\/span><br><span class=\"quote\">&gt;significant whitespace isn&#039;t<\/span><br><br>tep
        kok.","time":1398968708,"resto":41689166},{"no":41690550,"now":"05\/01\/14(Thu)14:48:48","name":"Anonymous","com":"<a
        href=\"#p41689247\" class=\"quotelink\">&gt;&gt;41689247<\/a><br>Python or
        maybe Perl<br>Read this =&gt; http:\/\/www.greenteapress.com\/thinkp<wbr>ython\/html\/index.html<br>ABC
        Always Be Coding","filename":"always_be_closing1","ext":".png","w":467,"h":326,"tn_w":125,"tn_h":87,"tim":1398970128533,"time":1398970128,"md5":"L6MTyHF8Dp6Z6b+epLf18w==","fsize":179805,"resto":41689166}]}'
